设有两非零正整数 \(a_1, b_1\) 且 \(a_1 > b_1\)，则取 \(p_1 = a_1 \mod b_1\) 如果 \(p_1 = 0\)，则说明 \(b_1\) 能整除 \(a_1\)，是 \(a_1\) 的因子 如果 \(p_1 \ne 0\)，则令 \(a_2 = b_1, b_2 = p_1\) 继续取 \(p_2 = a_2 \mod b_2\)，以此类推，直到 \(p_n = 0\) 为止 设 \(p\) 为 \(a, b\) 的因子，则有 \(a = pm, b = pn\)，则辗转相除的过程中，有 \(|m' - n'| \to 1\)，即可求出因子 \(p\)。 递归实现： fn gcd(a: u64, b: u64) -> u64 { let p = if a > b { a % b } else { b % a }; if p == 0 { b } else { gcd(b, p) }
} fn gcd(a: u64, b: u64) -> u64 { let (mut a, mut b) = if a < b { (b, a) } else { (a, b) }; while a % b != 0 { let t = b; b = a % b; a = t; } return b;
}

