} clap 库的解析器为一个 App 对象，它需要引用两类字符串，在一般的命令行工具中，这些字符串都是以静态数据的方式存储在二进制文件里的，因此可以用 'static 生命周期 clap 提供了名为 crate_version!,crate_name!,crate_description!,crate_name! 一系列宏，来从当前 crate 的 Cargo.toml 文件中读取对应字段的值 Arg 对象表示一个需要解析的参数，通过 Arg::with_name 设置该参数的标识符，在匹配之后，通过此标识符来寻找到该参数 在未设置 short 和 long 的情况下，参数将为 位置参数 ，根据传入时的位置进行匹配 .multiple(true) 表示此参数有多个值，命令行以 （空格）作为值的分隔符 fn main() { let args = get_cli_parser().get_matches(); let text = if let Some(texts) = args.values_of("STRING") { let texts: Vec<&str> = texts.into_iter().collect(); texts.join(" ").to_string() } else { String::new() }; loop { println!("{}", text); }
